function buildEdgeLinesForNode(nodeId){const ex=[],ey=[],ez=[];for(let i=0;i<EDGES.length;i++){const s=EDGES[i][0];const t=EDGES[i][1];if(s===nodeId||t===nodeId){const sp=NODE_POS[s];const tp=NODE_POS[t];if(sp&&tp){ex.push(sp.x,tp.x,null);ey.push(sp.y,tp.y,null);ez.push(sp.z,tp.z,null);}}}return {ex,ey,ez};}
function formatPropertyValue(val){if(val===null||val===undefined)return'<em>null</em>';if(typeof val==='object')return JSON.stringify(val,null,2);return String(val);}
window.addEventListener('load',()=>{const gd=document.getElementById('plot');gd.on('plotly_click',(ev)=>{if(!ev||!ev.points||!ev.points.length)return;const p=ev.points[0];if(!p.customdata)return;const nid=p.customdata[0];const nm=p.customdata[1];const st=p.customdata[2];const tp=p.customdata[3];const propsJson=p.customdata[4];let allProps={};try{allProps=JSON.parse(propsJson);}catch(e){console.error('Failed to parse properties:',e);}const panel=document.getElementById('info');document.getElementById('info-name').textContent=nm||("Node "+nid);document.getElementById('info-meta').textContent="State: "+st+"  Type: "+tp;const propsList=document.getElementById('info-properties');propsList.innerHTML='';const sortedKeys=Object.keys(allProps).sort();sortedKeys.forEach(key=>{const value=allProps[key];const li=document.createElement('div');li.style.marginBottom='4px';li.style.fontSize='12px';li.innerHTML='<strong>'+key+':</strong> '+formatPropertyValue(value);propsList.appendChild(li);});panel.style.display='block';const xr=[p.x-0.8,p.x+0.8];const yr=[p.y-0.8,p.y+0.8];const zr=[p.z-60*24*3600,p.z+60*24*3600];document.getElementById('btn-focus').onclick=()=>{Plotly.relayout(gd,{"scene.xaxis.range":xr,"scene.yaxis.range":yr,"scene.zaxis.range":zr,"scene.camera":{eye:{x:1.6,y:1.6,z:1.2}}});};document.getElementById('btn-neighbors').onclick=()=>{const lines=buildEdgeLinesForNode(nid);Plotly.restyle(gd,{x:[lines.ex],y:[lines.ey],z:[lines.ez]},[0]);};document.getElementById('btn-edges-all').onclick=()=>{Plotly.restyle(gd,{x:[EDGE_X_ALL],y:[EDGE_Y_ALL],z:[EDGE_Z_ALL]},[0]);};document.getElementById('btn-close').onclick=()=>{panel.style.display='none';};});});
